import React from "react";
import { Link } from "react-router-dom";

const Dropdown = () => {
  return (
    <div className="grid grid-rows-4 text-center items-center bg-yellow-500">
      <Link className="p-4 hover:bg-yellow-400 rounded transition duration-500" to="/">
        Home
      </Link>
      <Link className="p-4 hover:bg-yellow-400 rounded transition duration-500" to="/menu">
        Menu
      </Link>
      <Link className="p-4 hover:bg-yellow-400 rounded transition duration-500" to="/about">
        About
      </Link>
      <Link className="p-4 hover:bg-yellow-400 rounded transition duration-500" to="/contact">
        Contact
      </Link>
    </div>
  );
};

export default Dropdown;
